import React, {useState,useEffect} from 'react'
import { NavLink } from 'react-router-dom'
import logo from '../images/logo.jpeg'
import MenuIcon from '@material-ui/icons/Menu';

import Countdown from "react-countdown";


const Navbar = () => {

    const [counter, setCounter] = useState(120);
  useEffect(() => {
    counter > 0 && setTimeout(() => setCounter(counter - 1), 1000);
  }, [counter]);


    return (
        <>
            <nav className="flex menu justify-between items-center h-16 bg-white text-black relative shadow-sm m"><NavLink to="/">
            <img className="h-full logo" src={logo} alt="CODINGAL" /></NavLink>
                {/* logo */}
                <div className="px-4 my-auto h-16 cursor-pointer md:hidden">
                    <MenuIcon />
                </div>
                {/* manubar */}
                <div className="pr-8 md:block hidden">
                    <NavLink className="p-4" to="/">Trial lesson[Grade 1-3]</NavLink>
                    <NavLink className="p-4" to="/"><Countdown date={Date.now() + 600000}/></NavLink>
                    <div>Countdown: {counter === 0 ? "Time over" : counter}</div>
                    <button className="bg-red-500 hover:bg-red-700 text-white font-bold py-2 px-4 rounded">End Class</button>
                </div>
            </nav>
        </>
    )
}

export default Navbar
